import { Navbar, Nav } from 'react-bootstrap';
import AdminStyleSheet from '../style-sheets/adminStyleSheet';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {
  faEye as eye
  , faBan as ignore
  , faTag as tag
  , faEdit as edit
  , faPlus as reservation
  , faEnvelope as mail
  , faTrash as remove
} from '@fortawesome/free-solid-svg-icons';


const AdminToolbar = () => (
  <Navbar collapseOnSelect expand="lg" style={AdminStyleSheet.background} variant="dark">
    <Navbar.Brand href="#home" className="mr-auto">Muhalik</Navbar.Brand>
    <Navbar.Brand href="#home" className="mr-auto">Admin Dashboard</Navbar.Brand>
    <Nav>
      <FontAwesomeIcon icon={reservation} />
      <Nav.Link href=""> Signout </Nav.Link>
    </Nav>
  </Navbar>
);

export default AdminToolbar;

